#include <stdio.h>
#include <stdbool.h>
#include <stdlib.h>
#include <string.h>

#define MAX(a, b) ((a>b)?(a):(b))

int longestCommonSubsequence(char * text1, char * text2){
    int len1 = strlen(text1);
    int len2 = strlen(text2);

    // instead of a full sized matrix, only keep two arrays that represent dp[y] and dp[y+1].
    register int *dp1 = (int *)calloc(len2+1, sizeof(int));
    register int *dp2 = (int *)calloc(len2+1, sizeof(int));
    register int *temp;

    for (int y=len1-1; y >= 0; --y) {
        for (int x = len2-1; x >= 0; --x) {
            // printf("char %d: %c char %d: %c\n", y, char1, x, char2);
            if (text1[y] == text2[x]) {
                dp1[x] = 1 + dp2[x+1];
            }
            else {
                dp1[x] = MAX(
                    dp1[x+1],
                    dp2[x]
                );
            }
        };
        // swap dps
        temp = dp1;
        dp1 = dp2;
        dp2 = temp;
    };

    return dp2[0];
}

